import './App.css';

function App() {
    return (
        <div className="App"> 
            <header>
                <img src="" alt="Лого" />
                <ul>
                    <li>Главное</li>
                    <li>Информация</li>
                    <li>О нас</li>
                </ul>
            </header>
        </div>
    );
}

export default App;
